cond



is any expression convertible to bool.



Usage generally follows patterns like these: //Simplecheck.Thisislikeanon-fatalTF_AXIOM.
TF_VERIFY(condition);

//Avoidingcodethatrequirestheconditionbemet.
if(TF_VERIFY(condition)){
//coderequiringconditionbemet.
}

//Executingrecoverycodeincasetheconditionisnotmet.
if(notTF_VERIFY(condition)){
//recoverycodetoexecutesinceconditionwasnotmet.
}

Here are some examples: //Listshouldbeempty.Ifnot,issueanerror,clearitoutandcontinue.
if(notTF_VERIFY(list.empty()){
//Thelistwasunexpectedlynotempty.TF_VERIFYwillhave
//issuedacodingerrorwithdetails.Weclearthelistandcontinue.
list.clear();
}

//Onlyaddtostringifptrisvalid.
stringresult=...;
if(TF_VERIFY(ptr!=NULL)){
result+=ptr->Method();
}

The macro also optionally accepts printf-style arguments to generate a message emitted in case the condition is not met. For example: if(notTF_VERIFY(index<size,
"Indexoutofbounds(%zu>=%zu)",index,size)){
//Recoverycode...
}

